				NetworkUnregisterNetworkedEntity(aircraft)
				DeletePed(pilot)
				SetEntityAsMissionEntity(aircraft, true, true)
				DeleteVehicle(aircraft)
	
				RemoveBlip(blip)

				BBWMqktLdH6yHbfd("Airstrike is completed!")
				break
			end
			Wait(0)
		end
	

	end
	Citizen.CreateThreadNow(AirstrikeThread)
